import React from "react";
import './notes.module.css';
function Notes(){
    return (
        <>
            <div className="container">
                <div className="innerCont">
                    <label for="input1" className="formLabel" >Title</label>
                    <input type="text" className="formControl" id="title" />
                </div>
                <div className="innerCont">
                    <label for="input2" className="formLabel" >Description</label>
                    <textarea className="formControl" id="description" rows={3} />
                </div>
                <div className="innerCont">
                    <button type="button" id="addNote">Add Note</button>
                </div>
            </div>
        </>
    );
}

export default Notes;
